import React from "react";

class UserClass extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "dummy",
            location: "dummy"
        };
    }

    async componentDidMount(){
        // console.log(this.props.name +" Child component did mount");
        const userDataAPI = await fetch("https://api.github.com/users/pradneshbhike");
        const userData = await userDataAPI.json();
        console.log(userData);
        this.setState(userData);
    }

    render(){
        // console.log(this.props.name +" child render method");
        const { name, location, avatar_url } = this.state;
        // const { count, count2 } = this.State;
        return(
            <div>
                <h1>{name}</h1>
                <img alt="res-logo" src={avatar_url}></img>
                <h1>{location}</h1>

            </div>
        )
    }
} 

export default UserClass;
